// PDFInvoice.js
import React from "react";

export default function PDFInvoice({ cart, vehicleName, vehicleNumber, notes }) {
  const today = new Date().toLocaleDateString('en-GB');

  const calculateTotal = (qty, rate, discount) => {
    const gross = qty * rate;
    const discountAmount = gross * (discount / 100);
    return (gross - discountAmount).toFixed(2);
  };

  return (
    <div id="pdf-invoice" className="hidden print:block text-black text-[11px] p-6 max-w-4xl mx-auto">
      
      {/* Company Header */}
      <div className="text-center mb-6">
        <h1 className="text-2xl font-bold">🏢 JAI AYURVEDIC RESEARCH</h1>
        <p className="text-sm">GST No: XXXXXXXXXX | Jaipur, Rajasthan</p>
        <h2 className="text-xl font-bold mt-4 underline">📋 GOODS DISPATCH INVOICE</h2>
      </div>

      {/* Invoice Table */}
      <table className="w-full border border-collapse mt-4">
        <thead>
          <tr className="bg-gray-200">
            <th className="border px-2 py-1">Product</th>
            <th className="border px-2 py-1">Batch</th>
            <th className="border px-2 py-1">MFG</th>
            <th className="border px-2 py-1">EXP</th>
            <th className="border px-2 py-1">Qty (PCS)</th>
            <th className="border px-2 py-1">Rate</th>
            <th className="border px-2 py-1">Disc%</th>
            <th className="border px-2 py-1">Total</th>
          </tr>
        </thead>
        <tbody>
          {cart.map((item, i) =>
            item.entries.map((entry, idx) => {
              const qty = (entry.qty || 0) * (entry.ctn || 1);
              const rate = entry.rate || 0; // Assuming Rate is attached in cart
              const discount = entry.discount || 0;
              const total = calculateTotal(qty, rate, discount);

              return (
                <tr key={`${i}-${idx}`}>
                  <td className="border px-2 py-1">{item.name}</td>
                  <td className="border px-2 py-1">{entry.batch}</td>
                  <td className="border px-2 py-1">{entry.mfg}</td>
                  <td className="border px-2 py-1">{entry.exp}</td>
                  <td className="border px-2 py-1 text-center font-bold">{qty}</td>
                  <td className="border px-2 py-1 text-center">{rate}</td>
                  <td className="border px-2 py-1 text-center">{discount}%</td>
                  <td className="border px-2 py-1 text-center font-semibold">{total}</td>
                </tr>
              );
            })
          )}
        </tbody>
      </table>

      {/* Footer Details */}
      <div className="mt-6 space-y-1 text-sm">
        <p>🚛 <strong>Vehicle Name:</strong> {vehicleName || "N/A"}</p>
        <p>🔢 <strong>Vehicle Number:</strong> {vehicleNumber || "N/A"}</p>
        <p>📝 <strong>Notes:</strong> {notes || "-"}</p>
        <p>📅 <strong>Date:</strong> {today}</p>
      </div>

      {/* Signature and Stamp */}
      <div className="flex justify-between items-end mt-12 text-sm">
        <div className="text-left">
          <p>_______________________</p>
          <p>Authorized Signatory</p>
        </div>
        <div className="text-right">
          <p>_______________________</p>
          <p>Receiver's Stamp</p>
        </div>
      </div>

    </div>
  );
}
